require_main().config();
var { API_KEY, BETTING_ADDR, PRIVATE_KEY, CHESS_ADDR, VALIDATOR_ADDR } = process.env;
async function checkLeela() {
  const polygonMumbai = {
    name: "maticmum",
    chainId: 80001
  };
  const provider = new import_ethers9.providers.AlchemyProvider(polygonMumbai, API_KEY);
  const owner = new import_ethers9.Wallet(PRIVATE_KEY ?? "", provider);
  const bettingContract = BettingGame__factory.connect(BETTING_ADDR ?? "", owner);
  const chessContract = Chess__factory.connect(CHESS_ADDR ?? "", owner);
  const validatorContract = Validator__factory.connect(VALIDATOR_ADDR ?? "", owner);
  const client = new import_client_cloudwatch.CloudWatchClient({ region: "us-west-2" });
  bettingContract.on(bettingContract.filters.worldMovePlayed(), async function() {
    console.log("-------- Starting Leela Move --------");
    fs.rmSync("./proof_dir", { recursive: true, force: true });
    fs.mkdirSync("./proof_dir");
    var nnBoardRepr = await chessContract.convertToCircuit();
    fs.writeFileSync("./proof_dir/leelaInputs.json", JSON.stringify(nnBoardRepr.map((x) => x.toString())));
    (0, import_child_process.execFile)("./run_leela", (error, stdout, stderr) => {
      console.log("run leela exited");
      console.log(error);
      console.log(stdout);
      console.log(stderr);
    });
    console.log("run_leela is started!");
    await bettingContract.leelaHashInputs();
    console.log("inputs hashed!");
    await bettingContract.giveLeelaLegalMoves();
    await new Promise((resolve, reject) => {
      fs.watch("./proof_dir/", (eventType, fileName) => {
        if (fileName == "calc_output.json") {
          resolve(true);
        }
      });
    });
    await new Promise((resolve, reject) => setTimeout(() => resolve(true), 100));
    console.log("started hashing output!");
    var outputs = JSON.parse(fs.readFileSync("./proof_dir/calc_output.json").toString());
    var outputsBn = [];
    for (var i = 0; i < outputs.length; i++) {
      var outputBn = import_ethers9.BigNumber.from(outputs[i]);
      if (outputBn.isNegative()) {
        outputBn = outputBn.add(import_ethers9.BigNumber.from("0x30644e72e131a029b85045b68181585d2833e84879b9709143e1f593f0000001"));
      }
      outputsBn.push(outputBn);
    }
    var outputChunks = [outputsBn.slice(0, 250), outputsBn.slice(250, 500), outputsBn.slice(500, 750), outputsBn.slice(750, 1e3), outputsBn.slice(1e3, 1250), outputsBn.slice(1250, 1500), outputsBn.slice(1500, 1750)];
    var chunkStart = 0;
    var chunkEnd = 250;
    for (var chunk of outputChunks) {
      var trans = await validatorContract.hashOutputChunk(chunk, chunkStart, chunkEnd, { gasLimit: 15e6 });
      await trans.wait();
      chunkStart += 250;
      chunkEnd += 250;
    }
    await validatorContract.hashOutputChunk(outputsBn.slice(1750, 1858), 1750, 1858, { gasLimit: 15e6 });
    console.log("finished hashing output");
    await new Promise((resolve, reject) => {
      fs.watch("./proof_dir/", (eventType, fileName) => {
        if (fileName == "limbs_instance") {
          resolve(true);
        }
      });
    });
    await new Promise((resolve, reject) => setTimeout(() => resolve(true), 100));
    console.log("verifying leela move!");
    var proof_raw = fs.readFileSync("./proof_dir/proof");
    var proof_hex = "0x" + proof_raw.reduce((output, elem) => output + ("0" + elem.toString(16)).slice(-2), "");
    var instance_raw = fs.readFileSync("./proof_dir/limbs_instance");
    var instance_hex = "0x" + instance_raw.reduce((output, elem) => output + ("0" + elem.toString(16)).slice(-2), "");
    await bettingContract.makeLeelaMove(proof_hex, instance_hex, { gasLimit: 3e6 });
    var command = new import_client_cloudwatch.PutMetricDataCommand({ Namespace: "Leela/dev", MetricData: [{ MetricName: "LeelaMove", Value: Date.now() }] });
    await client.send(command);
    console.log("-------- Leela Move Played --------");
    console.log("");
  });
  bettingContract.on(bettingContract.filters.leelaMovePlayed(), async function() {
    console.log("-------- Starting Vote Timer --------");
    var timerLength = await bettingContract.getTimeLeft();
    await new Promise((resolve, reject) => setTimeout(() => resolve(true), timerLength.toNumber() * 1e3 + 1e3));
    var move = await bettingContract.getWorldMove();
    if (move != 0) {
      await bettingContract.callTimerOver();
      var command = new import_client_cloudwatch.PutMetricDataCommand({ Namespace: "Leela/dev", MetricData: [{ MetricName: "WorldMove", Value: Date.now() }] });
      await client.send(command);
      console.log("-------- World Move Played --------");
    } else {
      console.log("-------- No World Move Ready --------");
    }
    console.log("");
  });
}
checkLeela();
